(27, 'Dubai city', '<div><p style=\"border: 0px rgb(225, 225, 225); outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-bottom: 20px; line-height: 1.7; color: rgb(140, 140, 140); font-family: Poppins, sans-serif; text-align: justify;\">The land of sprawling shopping malls, diverse cuisines, dizzying glitz, engineering marvels and AvantGarde architecture, flamboyant entertainment, Bedouin displays, elegant belly dancers, blonde sandy shorelines, expansive dunes and adventurous desert safaris. Dubai is an oasis of indulgence in the Arabian Gulf.</p><p style=\"border: 0px rgb(225, 225, 225); outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin-bottom: 20px; line-height: 1.7; color: rgb(140, 140, 140); font-family: Poppins, sans-serif; text-align: justify;\">Why Go: Dubai invites you to explore its world famous landmarks The Burj Al Arab and the Burj Khalifa. Lounge on the pristine beaches of Jumeirah. Relish the Paradox of how the hottest desert in the world holds a mountain themed ski resort, the Ski Dubai. Ride on large waves of adventure at Dubais premier water park  the Wild Wadi.</p></div>', '2020-01-03', );
INSERT INTO `posts` (`post_id`, `post_title`, `post_content`, `upload_date`, `featured_image`) VALUES
(29, 'BOUDHANATH STUPA', '<div><div class=\"tourmaster-content-left\" style=\"border: 0px rgb(225, 225, 225); outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; padding-right: 20px; float: left; width: 534.047px; font-family: Poppins, sans-serif;\"><div class=\"tourmaster-tour-content\" style=\"border: 0px rgb(225, 225, 225); outline: 0px; vertical-align: baseline; background: transparent;\"><font color=\"#000000\">Boudha is among the largest Stupas in south Asia. It has become the focal point of Buddhism in Nepal. The white mound looms thirty six meters high. The Stupa is locat</font></div><div class=\"tourmaster-tour-content\" style=\"border: 0px rgb(225, 225, 225); outline: 0px; vertical-align: baseline; background: transparent;\"><font color=\"#000000\">ed on the ancient trade route to China. Tibetan merchants rested and offered prayers here</font>.</div></div></div>', '2019-12-30', );
INSERT INTO `posts` (`post_id`, `post_title`, `post_content`, `upload_date`, `featured_image`) VALUES
(30, 'PASHUPATINATH TEMPLE', '<div><p style=\"margin-top: 20px; margin-bottom: 20px; font-size: 16px; color: rgb(47, 47, 47); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(249, 249, 249);\">Dedicated to Lord Shiva, Pashupatinath is one of the four most important religious sites in Asia for devotees of Shiva. Built in the 5th century and &nbsp;later renovated by Malla kings, the site itself is said to have existed from the beginning of the millennium when a Shiva&nbsp;<em>lingam&nbsp;</em>was discovered here.</p><p style=\"margin-top: 20px; margin-bottom: 20px; font-size: 16px; color: rgb(47, 47, 47); font-family: &quot;Open Sans&quot;, sans-serif; background-color: rgb(249, 249, 249);\">The largest temple complex in Nepal, it stretches on both sides of the Bagmati River which is considered holy by Hindus.&nbsp; The main pagoda style temple has a gilded roof, four sides covered in silver, and exquisite wood carvings. Temples dedicated to several other Hindu and Buddhist deities surround the the temple of Pashupatinath.</p></div>', '2019-12-30', );
